import React from "react";
import Typography from '@mui/material/Typography';
import { Button } from "@mui/material";
import { makeStyles } from "@mui/material/core";

function Page(){
    return(
      <>
      <h1 style={{ color: "green" }} > Geeks for Geeks </h1>

      <h3 >React MUI Typography</h3>

      <Typography variant="h2" align="center">  I am h2 default variant. </Typography>

      <Typography variant="h3" color="primary"> I am h3 default variant.  </Typography>

      <Typography variant="h5" sx={{ ps: 5 }}> I am h5 default variant. </Typography>

      <Typography variant="overline" display="block" gutterBottom>Button text</Typography>

      <Button variant="text">Text</Button>
<Button variant="contained">Contained</Button>
<Button variant="outlined">Outlined</Button>
      </>
    );
}

export default Page;
